VALUES ('2240344003567', 'Al ajilli pavo', 'PECWGA PAVO Pechuga de pavo adobada al ajillo con agua anadida. Ir Producto cârnico. Ingredientes: 83% pechuga de pavo, agua, sal, azücar, antioxidantes: ascorbato sôdico, citratos de sodio; especias, conservador: nitrito sôdico; estabilizante: polifosfatos. Producto sin gluten ni lactosa (contenido de lactosa: &lt;0,01%). Modo de preparaciôn: En una sartén: Con poco aceite, a fuego medio durante 2 minutos por cada lado. Conservaci6n: Conservar refrigerado entre 0 oc y +4 oc. Una vez abierto, conservar refrigerado y cônsumir antes de 3 dias y siempre antes de la fecha de caducidad. Si se desea, puede congelar el producto en casa. Fecha de caducidad:/Lote: ver etiqueta frontale NO CONSUMIR EL PRODUCTO CRUDO. ENVASADO EN ATMCSFERA PROTECTORA', 'https://static.openfoodfacts.org/images/products/224/034/400/3567/front_fr.4.400.jpg', '0.9', '0.3', '0.1', '0.1', '', '22', '1.5', '0.590551181102362', '', '0');

